import React, { Component } from 'react';

class CategoryContainer extends Component {
  renderCategory() {}

  render() {
    return (
      <div className='categories'>
        <h5>Category Filters</h5>
        {this.renderCategory()}
      </div>
    );
  }
}

export default CategoryContainer;
